from selenium.common.exceptions import NoSuchElementException
from selenium.webdriver.common.proxy import Proxy, ProxyType
import undetected_chromedriver as uc


options = webdriver.ChromeOptions()
options.add_argument("user-agent=Mozilla/5.0 (Windows NT 10.0; Win64; x64)")
# options.add_argument('--headless=new')
driver = uc.Chrome()

# Helper function to safely get element text
def get_element_text(driver, by, value):
    try:
        element = driver.find_element(by, value)
        return element.text
    except NoSuchElementException:
        return ""

# Helper function to safely get an element's attribute
def get_element_attribute(driver, by, value, attribute):
    try:
        element = driver.find_element(by, value)
        return element.get_attribute(attribute)
    except NoSuchElementException:
        return ""

def handle_captcha():
    print("CAPTCHA detected! Please solve it manually if necessary.")
    WebDriverWait(driver, 300).until(  # Wait up to 5 minutes for CAPTCHA to be solved
        EC.presence_of_element_located((By.TAG_NAME, "h1"))
    )
    
# Function to scrape data from each URL
def scrape_url(url):
    data = {}
    try:
        driver.get(url)
        time.sleep(random.uniform(1, 3))
        # Wait for the page to load

        if "Verify you are human by completing the action below" in driver.page_source.lower():
            handle_captcha()
            
        WebDriverWait(driver, 10).until(EC.presence_of_element_located((By.TAG_NAME, "h1")))
        driver.execute_script("window.scrollTo(0, document.body.scrollHeight);")
        
        # Extract the desired elements
        data["name"] = get_element_text(driver, By.TAG_NAME, "h1")
        data["address"] = get_element_text(driver, By.CSS_SELECTOR, ".ont-bd-address")
        data["email"] = get_element_text(driver, By.CSS_SELECTOR, ".ont-btn-generic.email")
        data["phone"] = get_element_text(driver, By.CSS_SELECTOR, ".ont-btn-generic.phone")
        data["url"] = get_element_attribute(driver, By.CSS_SELECTOR, ".ont-btn-generic.website", "href")
    except Exception as e:
        print(f"Error scraping {url}: {e}")
    return data

# CSV file to save the results
output_csv = "hotels.csv"

